StoredProcedure.Body:
Begin
insert into identitytable
(NVarCharColumn
)
values
(NVarCharColumn
);
set IntColumn = LAST_INSERT_ID();
set TimestampColumn = CURRENT_TIMESTAMP();
End

Begin
if(
IntColumn = PK_IntColumn
) Then
update identitytable As T01 set 
T01.NVarCharColumn = NVarCharColumn

where T01.IntColumn = PK_IntColumn
and T01.TimestampColumn = PK_TimestampColumn
;
else
update identitytable As T01 set 
T01.NVarCharColumn = NVarCharColumn

where T01.IntColumn = PK_IntColumn
and T01.TimestampColumn = PK_TimestampColumn
;
end if;
set TimestampColumn = CURRENT_TIMESTAMP();
End

Begin
Set BigIntColumn = BigIntColumn + 1;
Set SmallIntColumn = SmallIntColumn + 1;

End
